review:
KovaaK's FPS Aim Trainer it is everything what you can imagine for improving your aim, reflex and accuracy. I have some experience with those tools and this is the best I ever had! Let me explain why.

Pros:
- Editing. You can change litreally everything what you want. Textures, weapons statics, abilites, moves of enemies, hud, options. It easy for change;
- Mapping and steam workshop;
- Input lag simualation;
- Tons of maps, weapons, bots and modes;
- Rankings;
- Mouse sensitivity calculator - you can use exactly same sensitivty from game  cs go, battalion, overwatch, quake and many more;
- Comunnity and very kind developer (https://discord.gg/36QtQr);
- Low price for that huge pack of content.

Summary: 10/10

I can really see how my aim changing for better when i using this software. I recommend it for all people who wants improve yourself in rts/fps games!
